import Map from "./Map.js";
import styled from "styled-components";

const Time = styled.div`
  img {
    position: absolute;
    top: 1140px;
    left: 750px;
    z-index: 10;
    width: 300px;
  }
`;

function RoadMap() {
  return (
    <>
      <Time>
        <img src={"img/time.png"}></img>
      </Time>
      <Map />
    </>
  );
}

export default RoadMap;
